import "./Item.css"

const Item = ({ card }) => {
  return (
    <div className="card" >
        <div>
        <img className="card-logo" src={card.img} alt="logo" />
        <h3 className="card-title"> {card.name} </h3>
        </div>
       {console.log(card)}
    </div>
  );
};

export default Item;
